from .prevoznik import Prevoznik
import requests
from bs4 import BeautifulSoup
import datetime
import re

class Arriva(Prevoznik):
	
	def __init__(self):
		self.seja = requests.Session()
		"""try:
			response = self.seja.get("http://193.95.251.195:35544/VozniRedi2/")
			html = BeautifulSoup(response.content, "html.parser")
		except Exception:
			pass"""
		self.prenesiSeznamPostaj()

	def prenesiSeznamPostaj(self):
		response = self.seja.get("http://193.95.251.195:35544/VozniRedi2/")
		html = BeautifulSoup(response.content, "html.parser")
		selector = html.find("select", {"id": "ddlOdhodna"})
		postajeOptions = selector.findAll("option")
		postaje = {}
		for postaja in postajeOptions:
			postaje[postaja.text.strip().replace("\x00", "")] = postaja["value"]
		self.postaje = postaje

	def seznamPostaj(self):
		if len(self.postaje) <= 0:
			self.prenesiSeznamPostaj()
		return [postaja for postaja in self.postaje]

	def obstajaPostaja(self, imePostaje):
		return imePostaje in self.postaje

	def prenesiSurovePodatke(self, vstopnaPostaja, izstopnaPostaja, datum):
		pretvorjenDatum = datum.strftime("%d.%m.%Y")
		unixTimestamp = int((datum - datetime.datetime(1970, 1, 1)).total_seconds() * 1000)
		vozniRedUrl = "http://193.95.251.195:35544/VozniRedi2/"

		podatki = {
			"ddlOdhodna": self.postaje[vstopnaPostaja],
			"ddlPrihodna": self.postaje[izstopnaPostaja],
			"calDatum_Raw": unixTimestamp,
			"calDatum": pretvorjenDatum,
			"__EVENTTARGET": "btnPrikazi",
			"__EVENTARGUMENT": "Click",
			"__VIEWSTATE": "",
			"__VIEWSTATEGENERATOR": "991D854F",
			"__EVENTVALIDATION": "",
			"__ASYNCPOST": "true"
		}

		# Without user agent, the server returns nothing
		headers = {
			"User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/69.0.3497.100 Safari/537.36"
		}

		response = self.seja.post(vozniRedUrl, data=podatki, headers=headers)
		html = BeautifulSoup(response.text, "html.parser")
		return html

	def prenesiVozniRed(self, vstopnaPostaja, izstopnaPostaja, datum):
		html = self.prenesiSurovePodatke(vstopnaPostaja, izstopnaPostaja, datum)

		# Ce ne najdemo voznega reda, je prikazana tabela kontrola vnosa
		if not html.find("table", {"id": "mGrd_DXMainTable"}):
			return []

		tabela = html.find("table", {"id": "mGrd_DXMainTable"})
		vrstice = tabela.findChildren("tr", recursive=False)

		# Dobimo naslove vrstic (prevoznik, prihod, odhod, ...)
		nasloviVrstic = ["odhod", "prihod", "trajanje", "razdalja", "naziv"]

		# Vse podatke shranimo v tabelo
		prevoziPodatki = []

		for vrstica in vrstice[1:]:
			besediloStolpcev = [stolpec.text.strip() for stolpec in vrstica.findChildren("td", recursive=False)[0:-1]]
			
			slovarPodatkov = dict(zip(nasloviVrstic, besediloStolpcev))
			#slovarPodatkov["url"] = potUrl
			
			# Ura prihoda in odhoda morata biti v datetime obliki
			uraPrihoda = datetime.datetime.strptime(slovarPodatkov["prihod"], "%H:%M")
			casPrihoda = datum.replace(hour=uraPrihoda.hour, minute=uraPrihoda.minute)
			slovarPodatkov["prihod"] = casPrihoda

			uraOdhoda = datetime.datetime.strptime(slovarPodatkov["odhod"], "%H:%M")
			casOdhoda = datum.replace(hour=uraOdhoda.hour, minute=uraOdhoda.minute)
			slovarPodatkov["odhod"] = casOdhoda

			# Ostali podatki
			slovarPodatkov["peron"] = ""
			slovarPodatkov["prevoznik"] = "Arriva"
			slovarPodatkov["cena"] = ""
			slovarPodatkov["url"] = ""

			prevoziPodatki.append(slovarPodatkov)

		return prevoziPodatki